import React from "react";

const LoginPage = () => {
    return(
        // <div>Hello World</div>
        <>
            <form action="">
                <div>
                    <label htmlFor="email">Email ID</label>
                    <input type="text" name="email" id="email"></input>
                </div>
                <div>
                    <label htmlFor="password">Password</label>
                    <input type="text" name="email" id="email"></input>
                </div>
            
            </form>        
        </>
        
    )   
}

export default LoginPage
